import React, { Component } from "react";

export default class Arrow extends Component {
    constructor(props) {
        super(props);
        this.state = {
            colStart: props.colStart,
            colEnd: props.colEnd,
            rowStart: props.rowStart,
            rowEnd: props.rowEnd
        }
    }

    render() {
        const svgStyle = {
            gridColumnStart: this.state.colStart,
            gridColumnEnd: this.state.colEnd,
            gridRowStart: this.state.rowStart,
            gridRowEnd: this.state.rowEnd,
        }
        const arrowStyle = {
            stroke: "rgb(0,0,0)",
            strokeWidth: 2,
            markerEnd: "url(#markerArrow)"
        }

        return (
            <svg height="80" width="360" style={svgStyle}>
                <defs>
                    <marker id="markerArrow" markerWidth="13" markerHeight="13" refX="2" refY="6"
                        orient="auto">
                        <path d="M2,2 L2,11 L10,6 L2,2" style={{ fill: "#000000" }} />
                    </marker>
                </defs>

                <line x1="0" y1="0" x2="200" y2="100" style={arrowStyle} />
            </svg>
        )
    }
}
